/* Peform MBIST check on firebolt6 */
soc_error_t
firebolt6_mem_bist(int unit)
{
    int i = 0;
    uint32 read_data = 0;
    uint32 read_control = 0;
    int initial_mbist_error_count = 0;
    int final_mbist_error_count = 0;
    int mbist_control_data_count = 0;
    int mbist_write_data_count = 0;
    int mbist_status_count = 0;

    /* Run the generated MBIST tests */
    for (i = 0; i < sizeof(firebolt6_mbist_commands); i++) {
        switch(firebolt6_mbist_commands[i]) {
            case ESW_MBIST_COMMAND_WAIT:
                /* Providing cycles for MBIST to complete */
                sal_usleep(500000);
                break;
            case ESW_MBIST_COMMAND_WRITE_DATA:
                WRITE_TOP_UC_TAP_WRITE_DATAr(unit,
                firebolt6_mbist_write_data[mbist_write_data_count]);
                mbist_write_data_count++;
                break;
            case ESW_MBIST_COMMAND_WRITE_CONTROL:
                WRITE_TOP_UC_TAP_CONTROLr(unit,
                firebolt6_mbist_control_data[mbist_control_data_count]);
                mbist_control_data_count++;
                break;
            case ESW_MBIST_COMMAND_READ_DATA:
                READ_TOP_UC_TAP_READ_DATAr(unit,&read_data);
                break;
            case ESW_MBIST_COMMAND_READ_CONTROL:
                READ_TOP_UC_TAP_CONTROLr(unit,&read_control);
                break;
            case ESW_MBIST_COMMAND_STATUS_FINAL:
                if((read_data & firebolt6_mbist_status[mbist_status_count]) !=
                    firebolt6_mbist_status[mbist_status_count]) {
                    final_mbist_error_count++;
                    LOG_ERROR(BSL_LS_APPL_TESTS,
                        (BSL_META_U(unit,
                         "Unit : %d, MBIST CSF ERROR[%d] at %d; Read: 0x%08X; Expected: 0x%08X\n"),
                         unit, final_mbist_error_count, mbist_status_count, read_data,
                         firebolt6_mbist_status[mbist_status_count]));
                }
                mbist_status_count++;
                break;
            case ESW_MBIST_COMMAND_STATUS_INITIAL:
                if((read_data & firebolt6_mbist_status[mbist_status_count]) !=
                    firebolt6_mbist_status[mbist_status_count]) {
                    initial_mbist_error_count++;
                    LOG_ERROR(BSL_LS_APPL_TESTS,
                        (BSL_META_U(unit,
                         "Unit : %d, MBIST CSI ERROR[%d] at %d; Read: 0x%08X; Expected: 0x%08X\n"),
                         unit, initial_mbist_error_count, mbist_status_count, read_data,
                         firebolt6_mbist_status[mbist_status_count]));
                }
                mbist_status_count++;
                break;
            default:
                return SOC_E_PARAM;
        }
    }

    /* Print out accumulated pass/fail results */
    if ((initial_mbist_error_count == 0) && (final_mbist_error_count == 0)) {
        cli_out("MEMORY BIST PASSED!\n");
    } else {
        if (initial_mbist_error_count != 0) {
            cli_out("Numbers of Initial MBIST status failures : %d\n",
                    initial_mbist_error_count);
        }
        if (final_mbist_error_count != 0) {
            cli_out("Numbers of Final MBIST status failures : %d\n",
                    final_mbist_error_count);
        }
    }
    return SOC_E_NONE;
}
